import styled from 'styled-components';

export const Item = styled.div`
    overflow: auto;
    padding: 20px 0;
    border-bottom: 1px solid #dcdcdc;
    margin-top: 100px;
    .pic {
        display: block;
        width: 125px;
        height: 100px;
        border-radius: 10px;
        border-style: solid;
        margin-left: auto;
        margin-right: auto;    
    }
`
